import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function SignUp(){
    return (
        <>
        SignUp
        </>
    )
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: colors.primary,
      alignItems: 'center',
      justifyContent: 'center',
      fontFamily:'Poppins',
      fontWeight:'bold'
    },
  });
